import React from 'react'
import Sidebar from './Sidebar'
import Content from './Content'

const Dashboard = () => {
  const sidebarStyle = {
    width: '250px',
  }

  const contentStyle = {
    width: '100%',
  }

  const dashStyle = {
    display: 'flex',
    alignItems: 'stretch',
  }

  return (
    <div style={dashStyle}>
      <Sidebar style={sidebarStyle} />
      <Content style={contentStyle} />
    </div>
  )
}

export default Dashboard
